package fonts

import (
	"io"
	"strings"

	"github.com/evocert/kwe/resources"
)

const indexcss string = `@font-face {
    font-family: Roboto;
    src: url(../roboto-v27-latin-regular.woff);
  }

  body {font-family: Roboto;}`

const roboto_v27_latin_regular_woff string = ``

func IndexCSS() io.Reader {
	return strings.NewReader(indexcss)
}

func RobotoV27LatinRegularWOFF() io.Reader {
	return strings.NewReader(roboto_v27_latin_regular_woff)
}

func init() {
	gblrs := resources.GLOBALRSNG()
	gblrs.FS().MKDIR("/roboto/css", "")
	gblrs.FS().MKDIR("/roboto/fonts", "")
	gblrs.FS().SET("/roboto/css/index.css", IndexCSS())
	gblrs.FS().SET("/roboto/fonts/roboto-v27-latin-regular.woff", RobotoV27LatinRegularWOFF())
}
